import React, { useState, useEffect } from "react";

function users() {
  return (
    <div className="person">
      <img
        className="avatar"
        src="https://www.bing.com/images/search?view=detailV2&ccid=HWt4Wxio&id=8A62A5585FE34C06BD8ADA3C3DE26189CC0E1F3A&thid=OIP.HWt4Wxio4q9hExwjxttoLwHaE8&mediaurl=https%3a%2f%2fth.bing.com%2fth%2fid%2fR.1d6b785b18a8e2af61131c23c6db682f%3frik%3dOh8OzIlh4j082g%26riu%3dhttp%253a%252f%252feverydayfeminism.com%252fwp-content%252fuploads%252f2015%252f01%252fMan-Smiling-with-Beard.jpg%26ehk%3d4Ke6RUXCVcyyAUG3GpS3LVLVYNPeMnfNfBZGUjSaMHo%253d%26risl%3d%26pid%3dImgRaw%26r%3d0&exph=3456&expw=5184&q=Human+Person&simid=608008537549661782&FORM=IRPRST&ck=B9489DC013BA3F7208CD2A2DB5672932&selectedIndex=10&itb=0&ajaxhist=0&ajaxserp=0"
      ></img>
    </div>
  );
}

function Invit() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    fetch("https://reqres.in/api/users")
      .then((res) => {
        if (!res.ok) {
          throw new Error("Network response was not ok");
        }
        return res.json();
      })
      .then((json) => {
        setUsers(json.data);
      })
      .catch((err) => {
        console.warn(err);
        alert("An error occurred");
      });
  }, []);
  return (
    <div className="invit">
      <div className="invit_content">
        <users />
        <button>send offer</button>
      </div>
    </div>
  );
}

export default Invit;
